import React from 'react'
import {  Box,Button,InputAdornment,TextField,Typography } from "@mui/material";
import PhoneIcon from '@mui/icons-material/Phone';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import SearchIcon from '@mui/icons-material/Search';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import PersonIcon from '@mui/icons-material/Person';

const Main = () => {
  return (
    <Box >
        <Box sx={{display:'flex',justifyContent:'center',gap:'10px',marginTop:'20px'}}>
        <PhoneIcon  sx={{position:'relative',color:'#90EE91',fontWeight:'400',fontSize:'25',top:5}}/>
        <Typography variant='h6' color='#90EE91'>7030 300 400</Typography>
        <Typography variant='h6' color='#90EE91' >Or</Typography>
        <Button variant='outlined'color='#90EE91' sx={{color:'#90EE91'}}>Get a callback</Button>
       </Box>
        <Box sx={{display:'flex',flexDirection:'row'}}>
            <img style={{height:'140px'}} 
            src='https://content.jdmagicbox.com/comp/pune/t3/020pxx20.xx20.220312055411.s6t3/catalogue/lupin-diagnostics-aundh-pune-pathology-labs-d14wkhwklq.jpg'/>
            
            <LocationOnIcon sx={{marginTop:8,marginLeft:'35px'}}/>
            <Typography variant='h6' sx={{marginTop:8,fontSize:'16px'}}>Mumbai</Typography>
            <KeyboardArrowDownIcon sx={{marginTop:8,position:'relative',top:3}}/>
            <TextField placeholder='Search tests/packages'
            sx={{marginTop:8,marginLeft:'35px',width:'30%'}} 
            size='small' 
            slotProps={{
                input:{
                    endAdornment:(
                        <InputAdornment position='end'>
                            <SearchIcon/>
                        </InputAdornment>
                    )
                }
            }}/>
            <Typography variant='h6' sx={{marginTop:8 ,fontSize:'16px'}}>Center Locator</Typography>
            <ShoppingCartIcon sx={{marginLeft:'35px',marginTop:8,fontSize:'16px',position:'relative',top:3}} />
            <Typography variant='h6' sx={{marginTop:8, fontSize:'16px'}} >Cart</Typography>
            <Button variant="contained" startIcon={<PersonIcon/>} color='#90EE91' sx={{marginLeft:'35px',marginTop:8,width:200, height:40}}>Customer Login</Button>
        </Box>
      
    </Box>
  )
}

export default Main
